from pybricks.parameters import Direction, Port
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import wait

# Set up all devices.
right = Motor(Port.A, Direction.CLOCKWISE)
left = Motor(Port.B, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(left, right, 81.4, 101.7182)


# The main program starts here.
# left wheel on second thick line,second thin line from corner on right (dont use this)
drive_base.use_gyro(True)
drive_base.settings(straight_speed=400)
drive_base.curve(110, 60)
drive_base.reset()
drive_base.curve(1000, 30)
drive_base.straight(75)
drive_base.settings(turn_rate=100)
drive_base.turn(32)
drive_base.settings(straight_speed=150)
drive_base.straight(240)
wait(400)
# finish whaling
drive_base.reset()
drive_base.settings(straight_speed=200)
drive_base.straight(-300)
drive_base.turn(-79)
drive_base.settings(straight_speed=1000)
drive_base.straight(460)
drive_base.straight(-245)
drive_base.turn(-43)
drive_base.settings(straight_speed=300)
drive_base.straight(450)
drive_base.curve(-260, -20)
